$(document).ready(function() {
  initFoundation($(this));
  initFormPlugins($(this));
  initFadeInElements();

  /*
   * Slider
   */
  $(".stage-slider").on("init", function(event, slick) {
    if (slick.slideCount === 1) {
      var $video = $(this)
        .closest(".stage-slider")
        .find("video");
      if ($video.length) {
        $video.attr("loop", "loop");
      }
    }
  });
  $(".stage-slider").on("init afterChange", function(event) {
    var $slider = $(this).closest(".stage-slider");

    if ($slider.find(".slick-slide.slick-active video").length) {
      var $video = $slider.find(".slick-slide.slick-active video").get(0);
      $video.play();
    } else if (event.type !== "init") {
      $slider.slick("slickPlay");
    }

    $slider.find(".with-fade-in").addClass("fade-in");
    $slider
      .find(".slick-slide.slick-active .with-fade-in")
      .removeClass("fade-in");
  });
  $(".stage-slider").on("beforeChange", function() {
    var $slider = $(this).closest(".stage-slider");
    $slider.find("video").each(function() {
      $(this).get(0).currentTime = 0;
    });
  });
  $(".slider-equalheight").on("init setPosition", function(event) {
    var $slider = $(this);
    setTimeout(function() {
      $slider.height("auto");
      $slider.height($slider.outerHeight());
    }, 100);
  });

  $(".slider-1-column").slick(getSliderOptions("one"));
  $(".slider-2-columns").slick(getSliderOptions("two"));
  $(".slider-3-columns").slick(getSliderOptions("three"));
  $(".video-slider").slick(getSliderOptions("video"));
  $(".restaurant-menu-slider").slick(getSliderOptions("restaurantMenu"));
  $(".fullwidth-slider").each(function() {
    $(this).slick(getSliderOptions("fullwidth", $(this)));
  });
  $(".stage-slider").slick(getSliderOptions("stage"));
  $(".stage-slider video").on("play", function() {
    var $video = $(this).get(0);
    setTimeout(function() {
      if ($video.currentTime > 0) {
        $(".stage-slider").slick("slickPause");
      }
    }, 500);
  });
  $(".stage-slider video").on("ended", function() {
    $(".stage-slider").slick("slickPlay");
    $(".stage-slider").slick("slickNext");
  });

  /*
   * Stage slider scroll link
   */
  $(".stage-slider .scroll").on("click", function() {
    scrollToElement($(".stage-slider").next(), 20);
  });

  /*
   * Images s/w
   */
  $(".logo-list").gray();

  /*
   * Lightbox
   */
  $(".js-open-lightbox").magnificPopup({
    type: "iframe",
    callbacks: {
      open: function() {
        if ($(".stage-slider .slick-slide.slick-active video").length) {
          var $video = $(".stage-slider .slick-slide.slick-active video").get(
            0
          );
          $video.pause();
        }
      },
      close: function() {
        if ($(".stage-slider .slick-slide.slick-active video").length) {
          var $video = $(".stage-slider .slick-slide.slick-active video").get(
            0
          );
          $video.play();
        }
      }
    }
  });

  /*
   * Lightbox small
   */
  $(".js-open-lightbox-small").magnificPopup({
    type: "iframe",
    mainClass: "lightbox-small"
  });

  /*
   * Cookie Control
   */
  $(document).on("click", ".cookie-control-open", function() {
    if (typeof CookieControl !== "undefined") {
      CookieControl.open();
    }
    return false;
  });

  /*
   * Browser detect
   */
  var oldBrowserVersions = {
    msie: 10,
    firefox: 10,
    chrome: 5,
    safari: 7
  };
  if (typeof oldBrowserRedirect !== "undefined") {
    if (
      (bowser.msie && bowser.version < oldBrowserVersions["msie"]) ||
      (bowser.firefox && bowser.version < oldBrowserVersions["firefox"]) ||
      (bowser.chrome && bowser.version < oldBrowserVersions["chrome"]) ||
      (bowser.safari && bowser.version < oldBrowserVersions["safari"])
    ) {
      window.location.href = oldBrowserRedirect;
    }
  }
   // newsletter-b stuff
  $(document).on("focus", "#newsletter-b-email-req", function() {
    document.querySelector('#newsletter-b .hidden').classList.add("show");
  })

  let newsletterBContainer = document.querySelector("#newsletter-b");
  if(newsletterBContainer) {
    newsletterBContainer.parentElement.setAttribute("id","newsletter-b-container");
    newsletterBContainer.setAttribute("action", newsletterBContainer.getAttribute("action") + "-container");
  }

  if(window.location.hash === "#newsletter-b" || window.location.hash === "#newsletter-b-container") {
    document.querySelector('#newsletter-b .hidden').classList.add("show");
  }
});

/*
 * Global toggle behaviour
 *
 * Toggle behaviour is controlled by data attributes
 * data-container: Common container class of hidden element and trigger element; defaults to 'columns'
 * data-target: Class of hidden element that shall be toggled; defaults to 'hidden-content'
 * data-trigger: Class of trigger element; only needed if there are multiple trigger elements for one hidden element
 * data-mode: Mode for toggling animation; 'slide' activates sliding animation, 'fade' actives sliding animation; default is no animation
 */
$(document).on("click", ".js-toggle", function() {
  var $trigger = $(this);
  var containerClass = $(this).data("container")
    ? $(this).data("container")
    : "columns";
  var targetClass = $(this).data("target")
    ? $(this).data("target")
    : "hidden-content";
  var triggerclass = $(this).data("trigger");
  var mode = $(this).data("mode") ? $(this).data("mode") : "slide";
  var $container = $(this).closest("." + containerClass);
  var $containerParents = $container.parents();
  var $target = $container.find("." + targetClass);

  $trigger.toggleClass("active");
  $container.toggleClass("active");

  if (mode === "slide") {
    if ($trigger.hasClass("active")) {
      $target.addClass("opening");
      $target.slideDown(function() {
        $target.removeClass("opening");
        $target.addClass("active");
      });
    } else {
      $target.addClass("closing");
      $target.slideUp(function() {
        $target.removeClass("closing");
        $target.removeClass("active");
      });
    }
  } else if (mode === "fade") {
    if ($(this).hasClass("active")) {
      $target.addClass("opening");
      $target.fadeIn(function() {
        $target.removeClass("opening");
        $target.addClass("active");
      });
    } else {
      $target.addClass("closing");
      $target.fadeOut(function() {
        $target.removeClass("closing");
        $target.removeClass("active");
      });
    }
  } else if (mode === "toggle") {
    $target.toggleClass("active");
    $target.toggle();
  }

  // Toggle active class for other trigger
  if (triggerclass) {
    $container
      .find("." + triggerclass)
      .not($(this))
      .toggleClass("active");
  }
});

/*
 * Load video iframe
 */
$(document).on("click", ".js-load-video-iframe", function() {
  var $container = $(this).closest(".video-preview");
  var $videoContainer = $container.find(".responsive-embed");
  var iframe = $(this).data("iframe");

  if (!iframe) {
    return;
  }

  $videoContainer.append(JSON.parse(iframe));
});

/*
 * Event tracking
 */
$(document).on("click", "a.js-track-event", function() {
  trackEvent(
    $(this).data("eventcategory"),
    $(this).data("eventaction"),
    $(this).data("eventlabel")
  );
});

$(document).on("change", "select.js-track-event", function() {
  trackEvent(
    $(this).data("eventcategory"),
    $(this).data("eventaction"),
    $(this)
      .find("option:selected")
      .text()
  );
});




$(window).on("resize", function() {
  if ($("[data-equalizer-watch]").length) {
    Foundation.reInit("equalizer");
  }
});

/*
 * Init Foundation
 */
function initFoundation(selector) {
  selector.foundation();
}

/*
 * Init Form Plugins
 */
function initFormPlugins(selector) {
  initChosen(selector.find("select"));
  initICheck(
    selector.find("input:checkbox, input:radio").not(".extbase-debugger input")
  );
}

/*
 * Init Chosen
 */
function initChosen(selector) {
  selector.chosen({
    disable_search: false,
    disable_search_threshold: 10,
    inherit_select_classes: true
  });
}

/*
 * Init iCheck
 */
function initICheck(selector) {
  selector.iCheck({
    inheritClass: true
  });
}

/*
 * Return slider options
 */
