/**
 * Update subgroup fields
 */
$('form select.js-update-subgroup').on('change', function() {    
    var value = $(this).val();
    var groups = $(this).data('groups');
    var $form = $(this).closest('form');
    var groupsToShow = [];
    
    $.each(groups, function(key, values) {
        values = values.split(',');
        
        $.each(values, function() {            
            if(key === value) {
                groupsToShow.push(this);
            } 
            else if($.inArray(this, groupsToShow)) {
                $form.find('#' + this).hide();
            }
        });
    });
    
    $.each(groupsToShow, function() {
        $form.find('#' + this).show();
    });
});

/*
 * Set reservation options based on selected losteria
 */
$('form select.js-select-losteria').on('change', function() {
    var url = $(this).closest('form').data('requesturl');
    var restaurant = $(this).val();
    var dateFormat = $(this).closest('form').find('input[id$=-date]').next().val();
    var $form = $(this).closest('form');
    
    $.ajax({
        url: url,
        data: {
            function: 'getRestaurantReservationOptions',
            restaurant: restaurant,
            dateFormat: dateFormat
        },
        dataType: 'json',
        method: 'POST',
        beforeSend: function() {
            disableLosteriaDependentFields($form);
        },
        success: function (data) {
            if(data) {   
                var $date = $form.find('input[id$=-date]');
                var $guests = $form.find('select[id$=-guests]');
                var $info = $form.find('div[id$=-info]');
                var $message = $form.find('textarea[id$=-message]');

                $date.datepicker('option', {
                    minDate: data.minDate,
                    maxDate: data.maxDate
                });

                if(data.disabledDates && data.disabledDates.length) {
                    $date.datepicker('option', {
                        beforeShowDay: function(date) {
                            var disabledDates = data.disabledDates;
                            var dateFormat = data.dateFormat;
                            return [disabledDates.indexOf($.datepicker.formatDate(dateFormat, date)) === -1];
                        }
                    });
                }
                $date.prop('disabled', false);
                $date.nextAll('.empty').prop('disabled', true);

                updateSelectOptions($guests, data.guests);
                $guests.prop('disabled', false).trigger('chosen:updated');
               
                if(data.hideMessage) {
                    $message.val('');
                    $message.closest('.form-row').addClass('hidden');
                }
                else {
                    $message.closest('.form-row').removeClass('hidden');
                }

                if(data.info) {
                    $info.find('.text').html(data.info);
                    $info.removeClass('hidden');
                } else {
                    $info.addClass('hidden');
                }

                if(!data.isExternalReservation) {
                    for (var i in Array.from(document.querySelectorAll('#reservation .form-row'))) {
                        let elem = document.querySelectorAll('.form-row')[i];
                        elem.classList.remove("hidden")
                    }
                    $('.externReservationField').addClass("hidden");
                    $('.js-select-losteria').closest('.form-row').removeClass('last-child');
                } else {
                    var $submitButton = $('.externReservationField .externSubmit');
                    $submitButton.attr("href", data.externalReservationLink);
                    $submitButton.data("type", data.externalReservationType);

                    // remove type specific functions
                    if(data.externalReservationType !== 'aleno') {
                        $submitButton.get(0).removeEventListener('click', alenoPopup.show, false);
                    }
                    if(data.externalReservationType !== 'seatris') {
                        $submitButton.off('click');
                    }

                    // add type specific functions
                    initExternalReservation();

                    for (var i in Array.from(document.querySelectorAll('#reservation .form-row.internReservationField'))) {
                        let elem = document.querySelectorAll('.form-row.internReservationField')[i];                                                            
                        elem.classList.add("hidden")
                    }
                    $('.externReservationField').removeClass("hidden");
                    $('.js-select-losteria').closest('.form-row').addClass('last-child');
                }

                if(data.info) {
                    $info.find('.text').html(data.info);
                    $info.removeClass('hidden');
                } else {
                    $info.addClass('hidden');
                }

                
            }
        }
    });
});

