$('form input.js-select-date').on('change', function() {
    var url = $(this).closest('form').data('requesturl');
    var restaurant = $(this).closest('form').find('select[id$=-losteria]').val();
    var date = $(this).val();
    var dateFormat = $(this).next().val();
    var $time = $(this).closest('form').find('select[id$=-time]');
    $(this).siblings('.error-description').remove();
    
    $.ajax({
        url: url,
        data: {
            function: 'getRestaurantReservationTimeOptions',
            restaurant: restaurant,
            date: date,
            dateFormat: dateFormat
        },
        dataType: 'json',
        method: 'POST',
        beforeSend: function() {
            $time.prop('disabled', true).trigger('chosen:updated');
        },
        success: function (data) {
            if(data) {
                updateSelectOptions($time, data);
                $time.prop('disabled', false).trigger('chosen:updated');
            }
        }
    });
});

/*
 * Update select with give options
 */
function updateSelectOptions($select, options) {
    $select.find('option').not(':first').remove();
    $.each(options, function(label, value) {
        $select.append($('<option>', {value: value, text: label}));
    });
    $select.trigger('chosen:updated');
}

/*
 * Disable all fields that depend on select losteria
 */
function disableLosteriaDependentFields($form) {
    $form.find('input[id$=-date]').val('').prop('disabled', true);
    $form.find('input[id$=-date]').nextAll('.empty').prop('disabled', false);
    $form.find('select[id$=-time]').val('').prop('disabled', true).trigger('chosen:updated');
    $form.find('select[id$=-guests]').val('').prop('disabled', true).trigger('chosen:updated');
    $form.find('div[id$=-info]').addClass('hidden');
}

function initExternalReservation()
{
    var $submitButton = $('.externReservationField .externSubmit');
    var type = $submitButton.data('type');

    if(type == 'aleno') {
        window.alenoPopup.init();
    }
    else if(type == 'seatris') {
        $submitButton.magnificPopup({
            type: "iframe",
            mainClass: "lightbox-small"
        });
    }
}